import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
    &:before{
        background-image: url(${BuildBG});
        background-size: cover;
        content: "";
        height: 130%;
        left: 0;
        position: absolute;
        top: 0;
        width: 100%;
        z-index: -1;
        padding-bottom: 10em;
    }
`

function Social() {
  return (
    <Container>

    </Container>
  )
}

export default Social
